import React, {useState} from 'react'

function Menu() {

    const [state, setstate] = useState("")
    const style = {
        margin:{
            marginLeft:"15%"
        }
    }


    return (

        <div className="container mt-1">
            <ul className="nav nav-pills" role="tablist" style={style.margin} > 
                <li className="nav-item">
                    <p className="btn  nav-link active" onClick={()=>setstate("credit")}>Creadit</p>
                </li>
                <li className="nav-item">
                    <p className="btn nav-link" onClick={()=>setstate("Debit")}>Debite</p>
                </li>
                <li className="nav-item">
                    <p className="btn nav-link" onClick={()=>setstate("View")}>View</p>
                </li>
            </ul>           
        </div>

    )
}

export default Menu
